import React from "react";
import ScooterGuy from '../../img/header_img/content_img.png';
export const MainPage = () => {
    return(
        <div className="mainPage">
            <div className="mainPage__wrap">
                <div className="mainPage__text-wrap">
                    <p className="mainPage__text-head">super fast Food delivery service</p>
                    <p className="mainPage__text-desc">super fast Food delivery service</p>
                </div>

                <div className="mainPage__img-wrap">
                    <img src={ScooterGuy}/>
                </div>
            </div>
        </div>
    );
};
